import React from 'react'
import { Link } from 'react-router-dom'
import './Nav.css'
import logo from './logo.png'

function Nav() {
  return (
    <div className='navBar'>
      <img src={'logo.png'} className='logo' alt='logo'/>
      <Link to='/'><h1>Vendor Connector</h1></Link>
      {/* <img src={'images/Me.jpg'}/> */}

    </div>
  )
}

export default Nav
